# Certificate image embedded as base64
CERTIFICATE_DATA = """"""

# Initialize session state
if 'show_certificate' not in st.session_state:
    st.session_state.show_certificate = False
if 'nope_count' not in st.session_state:
    st.session_state.nope_count = 0

def show_certificate():
    st.session_state.show_certificate = True

def increment_nope():
    st.session_state.nope_count += 1
    messages = [
        "Nice try! üòè",
        "Can't escape! üíï",
        "Still trying? üòÇ",
        "You know you want to click YES! üíù",
        "Almost there... üòä",
        "Just click YES already! üéâ",
        "Come on! üòÑ",
        "YES is waiting for you! ‚ú®"
    ]
    if st.session_state.nope_count <= len(messages):
        st.toast(messages[min(st.session_state.nope_count - 1, len(messages) - 1)], icon="üíï")

# Main app logic
